function: "This is a reel for the nylon filament.\r\nOr, any kind of filament you want to use!\r\nI ordered some nylon filament and it did not come with a spool.\r\nSo, I made my own.\r\nThis spool will require you to use the filament holder from octave.com.\r\nIt is a free download.\r\nYou could find some octave filament holders on this site, too!\r\n\r\nI believe, now though, they are shipping the nylon on spools!\r\ntaulman3d.com\r\nI am using it on my Afinia 3D printer."
